1. Objet  
Les présentes conditions générales d’utilisation (ci-après « Conditions Générales d’Utilisation » ou « CGU ») ont pour objet de définir et d’encadrer les modalités d’utilisation du Site M&VOUS. Elles déterminent les droits et obligations respectifs de Médiamétrie, éditeur du site (ci-après « MEDIAMETRIE »), et de l’utilisateur (ci-après l’« Utilisateur ») qui désigne toute personne physique participant à un panel de mesure d’audience MEDIAMETRIE qui devient Utilisateur du site internet en créant son mot de passe. Le Site M&VOUS permet à l’Utilisateur d’accéder à plusieurs fonctionnalités, à savoir :   
- consulter sa cagnotte ;  
- passer une commande ;  
- visualiser ses équipements ;  
- déclarer une absence conformément à ses obligations en tant que panéliste ;  
- contacter l’équipe panel dédiée en cas de question ou réclamation via chat ; 
- demander un rendez-vous pour être rappelé par l’équipe panel dédiée ;  
- se renseigner sur les règles de participation.
